import ExpenseItem from "./components/Expenseitem";


//import Expense from "./components/Expense";


function App(props) {


  return (
    <div>
    <h2>Let's get started!</h2>
    <ExpenseItem
      amount={props.expenses[0].amount}
      date={props.expenses[0].date}
    ></ExpenseItem>

  </div>
);
}


export default App;
